<?php

use Slim\Http\Request;
use Slim\Http\Response;
use PHPMailer\PHPMailer\PHPMailer;
use PHPMailer\PHPMailer\Exception;

//Load Composer's autoloader
require '../vendor/autoload.php';

require 'dao.php';
// Routes

$app->get('/listagemCotacaocliente/{idCliente}', function ($request, $response, $args) {
    $listagem = listarCotacaoPorCliente($this->db, $args['idCliente']);
    return $this->response->withJson($listagem);
});

$app->get('/imprimircotacao/{idCotacao}', function ($request, $response, $args) {
    $listagem = impressaoCotacao($this->db, $args['idCotacao']);
    return $this->response->withJson($listagem);
});

$app->post('/cotacao', function ($request, $response, $args) {
    $produto = $request->getParsedBody();
    $cotacao = listarCotacaoMenorPreco($this->db, $produto);
    return $this->response->withJson($cotacao);
});

$app->post('/cotacaoregistrar', function ($request, $response, $args) {
    $modelDadosCotacao = $request->getParsedBody();
    $dadosCliente = $modelDadosCotacao['cliente'];
    $dadosCotacao = $modelDadosCotacao['cotacao'];

    
    $cotacao = cadastrarCotacao($this->db,  $dadosCliente, $dadosCotacao);
    $result = array();
    $resultItem = array(
        "cotacao" => $cotacao,
        "mensagem" => "Cotacao registrada com sucesso."
    );
    array_push($result,$resultItem);
    return $this->response->withJson($result);
});

$app->post('/emailoferta', function ($request, $response, $args) {
  $post = $request->getParsedBody();
  //instancia a classe
  $mail = new PHPMailer();
  //defini que será enviado via SMTP
  $mail->IsSMTP(true);
  //define que será autenticado
  $mail->SMTPAuth = true;
  //debug
  $mail->SMTPDebug = 2; 
  //tipo de segurança
  $mail->SMTPSecure = 'ssl';
  //altera a porta de envio
  $mail->Port = 465;
  //define o endereço SMTP
  $mail->Host = 'smtp.gmail.com';
  //Define o nome do usuário
  $mail->Username = 'gabriellemacieel@gmail.com';
  //define a senha o usuário
  $mail->Password = 'g4b33100216';

  $mail->setFrom('gabriellemacieel@gmail.com', 'Gabrielle');
        
  //Informa o email e nome de quem está enviado
    
  foreach($post as $key=>$item){
      //Informa o email e nome de quem irá receber o email
      $mail->AddAddress( $item["email"], $item['nome']);
        
      //$mail->addAddress("moniquermyrria@gmail.com", 'Monique');
      $mail->isHTML(true);
      //titulo da mensagem que será enviada
      //$mail->CharSet = 'UTF-8';
      $mail->Subject = 'OFERTAS IMPERDIVEIS MARKETPECAS';
      //a mensagem que está sendo enviada
      $mail->MsgHTML('
      <!DOCTYPE html>
      <html>

      <head>
          <meta name="viewport" content="width=device-width, initial-scale=1">
          <style>
              img {
                  display: block;
                  margin-left: auto;
                  margin-right: auto;
              }
          </style>
      </head>

      <body><img
              src="data:image/jpeg;base64,"
              alt="oferta-mkt.jpg" style="max-width:100%;"></body>

      </html>
      ');

      $mail->Send();

      //testa se foi enviada ou não
      if($mail->Send())
        echo 'E-mail enviado com sucesso!';
      else
        echo 'Erro ao enviar o email '.$mail->ErrorInfo;
  }
  return $this->response->withJson($post);
     
});
